INSERT INTO `recipes` (`id`, `name`, `details`, `picture`, `user_id`) VALUES
(49, 'Hólabda', 'A hólabda tésztájához a tojásokat szétválasztjuk. A tojássárgáját habosra keverjük a porcukorral. A liszthez hozzáadjuk a sütőport és a kakaóport. Felverjük keményre a tojásfehérjét, majd felváltva a sárga masszához adagoljuk a lisztet és a habot, vigyázva, hogy ne törjön össze nagyon a hab.\r\n\r\nKivajazott, kilisztezett tepsibe öntjük a tésztát, és 180 fokra előmelegített sütőben kb. 20 percig, tűpróbáig sütjük.\r\n\r\nEzalatt elkészítjük a krémet. A tejet a liszttel teljesen simára kikeverjük, és sűrűre főzzük, majd kihűtjük. Habosra keverjük a porcukrot a vajjal, és a kihűlt lisztes masszát ebbe beleöntjük, és jól beledolgozzuk. A végén beleöntjük a rumot is.\r\n\r\nA kihűlt kakaós tésztát 4-5 cm átmérőjű pogácsaszaggatóval kiszúrjuk. Minden darabot keresztben kettévágunk, megkenjük a krémmel, visszahelyezzük a tetejét, az oldalát is szépen körbekenegetjük, és a kókuszreszelékbe beleforgatjuk az oldalukat.\r\n\r\nElkészítjük a csokimázt a tetejére. Mindent jól összekeverünk, és 1-2 perc alatt felmelegítjük. A sütik tetejét az elkészült csokival bevonjuk. Hűlni hagyjuk, és lehet fogyasztani. \r\n', , 8);
INSERT INTO `recipes` (`id`, `name`, `details`, `picture`, `user_id`) VALUES
(50, 'Klasszikus Sportszelet', 'A margarint kockákra vágjuk, vastag aljú fazékba tesszük. Hozzáadjuk a cukrot és a kakaóport, alaposan elkeverjük. Majd felöntjük a tejjel és folyamatos kevergetés mellett felfőzzük.\r\n\r\nAmint felforrt, levesszük a tűzről, majd belekeverjük a darált kekszet és a rumaromát. Alaposan összedolgozzuk, picit lehűtjük. Az így kapott csokis masszát belenyomkodjuk egy sütőpapírral bélelt tepsibe vagy jénai tálba.\r\n\r\nA tetejére elkészítjük a csoki mázat, amelyhez szintén egy vastag aljú edénybe tesszük a cukrot, a kakaót és a vizet. Főzni kezdjük, addig kevergetjük a tűz felett, amíg be nem sűrűsödik. Ekkor egyenletesen a kakaós, kekszes süteményre öntjük, és hagyjuk megdermedni. ', , 9);

